import React from 'react';

const AboutSection = () => {
  return (
    <section className="py-16 bg-gray-100">
      <div className="max-w-6xl mx-auto px-4 text-center">
        <h2 className="text-4xl font-bold text-gray-900 mb-8">Sobre Kiki LBK</h2>
        <p className="text-lg text-gray-700 leading-relaxed mb-8">
          En Kiki LBK Barbería, nos dedicamos a ofrecer una experiencia de barbería única, combinando técnicas clásicas con las últimas tendencias en cortes y estilos. Nuestro objetivo es que cada cliente salga sintiéndose renovado y con un look impecable.
        </p>
        <p className="text-lg text-gray-700 leading-relaxed mb-8">
          Estamos ubicados en Caacupé y puedes contactarnos al <a href="tel:+595994116266" className="text-blue-600 hover:underline">0994116266</a> para agendar tu próxima cita. ¡Te esperamos!
        </p>
      </div>
    </section>
  );
};

export default AboutSection;
